import React, { Fragment, useState } from 'react';
import { Form, Input, Button, Radio, Checkbox, Row, Col } from 'antd';
import 'antd/dist/antd.css';
import { Link } from 'react-router-dom';

const formItemLayout = {
  labelCol: {
    span: 6,
  },
  wrapperCol: {
    span: 14,
  },
};

const Registration = () => {
  const [hasChildren, setHasChildren] = useState();

  return (
    <Fragment>
      <Form
        name="registration"
        {...formItemLayout}
        autoComplete="off"
      >
        <Form.Item
          label="Username"
          name="username"
          rules={[
            {
              required: true,
              message: 'Please input your username!',
            }
          ]}
        >
          <Input />
        </Form.Item>

        <Form.Item
          label="Password"
          name="password"
          rules={[
            {
              required: true,
              message: 'Please input your password!',
            }
          ]}
        >
          <Input.Password />
        </Form.Item>

        <Form.Item name="radio-group" label="Gender">
          <Radio.Group>
            <Radio value="male">Male</Radio>
            <Radio value="female">Female</Radio>
            <Radio value="other">Other</Radio>
          </Radio.Group>
        </Form.Item>

        <Form.Item name="checkbox-group" label="Checkbox.Group">
          <Checkbox.Group>
            <Row>
              <Col span={8}>
                <Checkbox
                  value="married"
                  style={{
                    lineHeight: '32px',
                  }}
                >
                  Married
                </Checkbox>
              </Col>
              <Col span={8}>
                <Checkbox
                  value="D"
                  style={{
                    lineHeight: '32px',
                  }}
                >
                  D
                </Checkbox>
              </Col>
              <Col span={8}>
                <Checkbox
                  value="E"
                  style={{
                    lineHeight: '32px',
                  }}
                >
                  E
                </Checkbox>
              </Col>
              <Col span={8}>
                <Checkbox
                  value="F"
                  style={{
                    lineHeight: '32px',
                  }}
                >
                  F

                </Checkbox>
              </Col>
              <Col>
                <Checkbox onClick={() => setHasChildren(!hasChildren)} >
                  have children
                  {hasChildren ? <Input style={{ width: 100, marginLeft: 10 }} /> : null}
                </Checkbox>
              </Col>
            </Row>
          </Checkbox.Group>
        </Form.Item>

        <Form.Item
          wrapperCol={{
            offset: 6,
            span: 18,
          }}
        >
          <Button type="primary" htmlType="submit">
            Sign in
          </Button>
          <Button type="link">
            <Link to="/login">Go to Login</Link>
          </Button>
        </Form.Item>
      </Form>
    </Fragment >
  );
};

export default Registration;
